history.p:
Salmen hører til blandt Luthers tidligste. Den udkom første gang i et enkelttryk i 1524 og blev optaget i Eyn Enchiridion (Erfurt 1524). 
                  Melodien synes at være baseret på den verdslige Mariasang fra 1400-tallet, Maria gottes genaden voll (Korth 2017:41; 
                  Leaver 2017:71-72).
